import React from 'react';
import './css/footer.css';

const Footer = () => {
  return (
    <footer >
      <p><strong>Mi Catálogo de Ropa</strong></p>
      <p>Dirección: Calle 123 #45-67, Ciudad Ejemplo</p>
      <p>Teléfono: (601) 123-4567</p>
      <p> <a href="https://wa.me/573001234567"  target="_blank" rel="noopener noreferrer" > WhatsApp: +57 300 123 4567 </a> </p>
      <p>Email: contacto@micatalogo.com</p>
    </footer>
  );
};

export default Footer;
